import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div class="social">
            <a href="https://github.com/subash30361360" target="_blank" rel="noopener noreferrer"><i class="fab fa-github"></i></a>
            <a href="https://www.instagram.com/subash_girii/" target="_blank" rel="noopener noreferrer"><i class="fab fa-instagram"></i></a>
            <a href="https://www.facebook.com/subashgiri0111/" target="_blank" rel="noopener noreferrer"><i class="fab fa-facebook-f"></i></a>
            <a href="https://www.linkedin.com/in/subash-giri-23b371212/" target="_blank" rel="noopener noreferrer"><i class="fab fa-linkedin-in"></i></a>
            </div>
            )
        }
    }

export default Social
